import React from "react";

export const Category = ({ category, icon: Icon }) => {
  return (
    <div
      className={`flex flex-col gap-4 rounded-2xl bg-purple-500/90 p-4 h-fit w-40`}
      //   className={`flex flex-col gap-4 rounded-2xl bg-${category.color}-500/75 p-4 h-fit w-40`}
    >
      <div className="flex">
        {/* <span className={`bg-white p-2 rounded-full text-${category.color}-400`}> */}
        <span className={`bg-white p-2 rounded-full text-purple-500/80`}>
          <Icon className="text-xl" />
        </span>
      </div>
      <div className="flex flex-col gap-0 font-bodyFont">
        <span className="text-base text-white font-bold">{category.name}</span>
        <span className=" text-gray-200 text-sm font-light">
          {category.files} files
        </span>
      </div>
    </div>
  );
};
